@LeoRemainsDark Indus flows down Ladakh in India, not just POK.

So, the claim that India taking over POK somehow puts Indus flow at risk is a bogus argument.

No need to make false analogies by speaking of China and what it does, when India and Pakistan have a Indus Water Treaty in force.

@RichardMarlesMP Are we trying to compete China in the Solomon Islands?

"no.. we've just got to focus on our own relationships with Solomon Island and indeed with the countries of the Pacific -"

- @RichardMarlesMP (PT 1)
